CREATE TABLE IF NOT EXISTS `dladata` (
  `dla_id` char(7) NOT NULL,
  `dla_name` varchar(200) DEFAULT NULL,
  `dla_province` varchar(50) DEFAULT NULL,
  `dla_amphur` varchar(50) DEFAULT NULL,
  `dla_tambon` varchar(50) DEFAULT NULL,
  `dla_typename` varchar(50) DEFAULT NULL,
  `dla_depname` varchar(50) DEFAULT '15000-กระทรวงมหาดไทย'
  )ENGINE=InnoDB DEFAULT CHARSET=utf8;

ALTER TABLE `dladata`
  ADD PRIMARY KEY (`dla_id`);

